import React from 'react';
import styles from './styles.module.css';

const AdminHomePage = () => {
  return (
    <div className={styles.homePage}>
      <h1 className={styles.homeText}>Admin Home Page</h1>
    </div>
  );
};

export default AdminHomePage;
